import { S } from "../Skills_Styles"
import { Icon } from "../../../../components/icon/Icon";

type SkillPropsType = {
  iconId: string;
  title: string;
};

export const Skill = (props: SkillPropsType) => {
  return (
    <S.StyledSkill>
      <S.IconWrapper>
        <Icon iconId={props.iconId} />
      </S.IconWrapper>
      <S.SkillTitle>{props.title}</S.SkillTitle>
    </S.StyledSkill>
  );
};
